(156, 253, '5mg PO qDay', 'For use in patients taking systemic corticosteroids (i.e., equivalent to prednisone 7.5 mg/day PO or more). The optimal treatment duration has not been determined; reevaluate treatment on a periodic basis. For those patients at low risk for fracture, consider stopping alendronate after 3 to 5 years. After discontinuation of therapy, continue to periodically reassess fracture risk. Per guidelines, only use in patients with moderate to high risk for fracture; not recommended if low fracture risk.', '!', '2023-05-10 13:27:20', '2023-05-10 13:27:20'),
(157, 254, '10mg PO qDay', 'OR 70mg PO once weekly; supplement calcium and vitamin D if dietary intake is inadequate. The optimal treatment duration has not been determined; reevaluate treatment on a periodic basis.', '!', '2023-05-10 13:27:53', '2023-05-10 13:27:53'),
(158, 255, '10mg PO qDay', 'OR 70mg PO once weekly; continue alendronate for up to 10 years in postmenopausal women who are initially at very high risk of fracture and remain at high risk. Consider discontinuation after 5 years of stability in high-risk postmenopausal women. For those patients at low or moderate risk for fracture, consider stopping alendronate after 3 to 5 years. After discontinuation of therapy, continue to periodically reassess fracture risk.', '!', '2023-05-10 13:28:49', '2023-05-10 13:28:49'),
(159, 256, '5mg PO qDay', 'OR 35mg PO once weekly; Use of alendronate to prevent bone loss can be considered in postmenopausal women with low bone mineral density (T-score less than -1) and other risk factors for fracture who do not meet criteria for osteoporosis treatment; for those patients at low risk for fracture, consider stopping alendronate after 3 to 5 years.', '!', '2023-05-10 13:29:25', '2023-05-10 13:29:25'),
(160, 257, '40mg PO qDay for 6 months', 'Retreatment may be considered after a 6-month post-treatment evaluation period, if failed in serum alkaline phosphatase normalization. Guidelines recommend a single dose of zoledronic acid preferentially due to the rare need for retreatment within 5 years, but the alendronate regimen is also an acceptable option. There are long-term data for reducing pain and lytic lesions and improving quality of life.', '!', '2023-05-10 13:29:58', '2023-05-10 13:29:58'),
(161, 258, '10mg PO qDay', 'For postmenopausal women who are not taking estrogen hormonal replacement, the dose is 10 mg PO daily for female patients taking systemic corticosteroids (i.e., equivalent to prednisone 7.5 mg/day PO or more). The optimal treatment duration has not been determined; reevaluate treatment on a periodic basis. For those patients at low risk for fracture, consider stopping alendronate after 3 to 5 years. After discontinuation of therapy, continue to periodically reassess fracture risk. Per guidelines, only use in patients with moderate to high risk for fracture; not recommended if low fracture risk.', '!', '2023-05-10 13:31:14', '2023-05-10 13:31:14'),
(162, 261, 'Not Recommended', 'Alendronate is not recommended here according to your patient\'s kidney status', '!', '2023-05-10 19:54:51', '2023-05-10 17:54:51'),
