(179, 282, '6mg Vial X 500ml NS IV over 2h', 'Alkaline phosphatase normalization is the evidence of good response; ibandronate has only been studied for short-term control of Paget\'s disease. Guidelines recommend other bisphosphonates (e.g., zoledronic acid) preferentially for Paget\'s disease due to long-term data with those medications at reducing pain and lytic lesions and improving quality of life.', '!', '2023-05-10 19:41:01', '2023-05-10 19:41:01'),
(180, 283, '4mg Vial X 500ml NS IV over 2h', 'Modified dose according to your patient\'s renal status', '!', '2023-05-10 19:44:14', '2023-05-10 19:44:14'),
(181, 284, '2mg X 500ml NS IV over 2h', 'Some studies demonstrated that, ibandronate might be a feasible treatment option for HD patients who develop low BMD (osteoprosis)', '!', '2023-05-10 19:44:40', '2023-05-10 19:44:40'),
(182, 286, '2mg X 500ml NS IV over 2h', 'Modified dose according to your patient\'s renal status', '!', '2023-05-10 19:48:54', '2023-05-10 19:48:54'),
(183, 287, '2mg X 500ml NS IV over 2h', 'Some studies demonstrated that, ibandronate might be a feasible treatment option for HD patients who develop low BMD (osteoprosis)', '!', '2023-05-10 19:49:57', '2023-05-10 19:49:57'),
(186, 290, '5mg/100ml Vial IV over 30min once a year', 'It\'s recommended to be preceeded by vit D bolus dose of 50,000-125,000IU PO/IM especially in patients with a recent low trauma hip fracture. The need for continued treatment should be re-evaluated regularly, particularly after ≥ 5 years of use', '!', '2023-05-10 22:32:01', '2023-05-10 22:32:01'),
(187, 291, '5mg/100ml Vial IV over 30min once a year', 'It\'s recommended to be preceeded by vit D bolus dose of 50,000-125,000IU PO/IM especially in patients with a recent low trauma hip fracture. The need for continued treatment should be re-evaluated regularly, particularly after ≥ 5 years of use', '!', '2023-05-10 22:32:33', '2023-05-10 22:32:33'),
(188, 292, '5mg/100ml Vial IV over 30min once a year', 'It\'s recommended to be preceeded by vit D bolus dose of 50,000-125,000IU PO/IM especially in patients with a recent low trauma hip fracture. The need for continued treatment should be re-evaluated regularly, particularly after ≥ 5 years of use', '!', '2023-05-10 22:33:00', '2023-05-10 22:33:00'),
(189, 293, '5mg/100ml Vial IV over 30min once', 'Plus 500mg calcium PO q12h for at least 10 days following zoledronic acid; most patients of paget\'s disease respond well to the lone dose and remission induced at 1 year. If relapse occurs, you can retreat with the same dose after 1 year interval from the intial dose', '!', '2023-05-10 22:33:49', '2023-05-10 22:33:49'),
(190, 294, '3.5mg X 100ml NS/D5W IV over 30min', 'According to your patient\'s renal status, omit 12.5ml of (4mg X 100ml NS/D5W) solution to get 3.5mg dose which is maximally allowed here', '!', '2023-05-10 22:37:26', '2023-05-10 22:37:26'),
(191, 295, 'Not Recommended', '!', '!', '2023-05-11 09:08:20', '2023-05-11 07:08:20'),
(192, 296, 'Contraindicated', 'Zoledronic acid is CI here according to your patient\'s kidney status', '!', '2023-05-10 22:40:35', '2023-05-10 22:40:35'),
(193, 297, 'Contraindicated', 'Zoledronic acid is CI here as your patient is pregnant', '!', '2023-05-10 22:41:31', '2023-05-10 22:41:31'),
(194, 298, 'Choose Indication', '!', '!', '2023-05-11 06:36:11', '2023-05-11 06:36:11'),
(195, 299, '4mg Vial X 100ml NS/D5W IV over 30min once', 'The 4mg dose here is superior to 5mg dose and more suitable for cancer patients as associated with lower risk of renal dysfunction. Patients should have their serum creatinine levels assessed prior to the dose of Zoledronic acid.', '!', '2023-05-11 06:48:26', '2023-05-11 06:48:26'),
(196, 300, '4mg Vial X 100ml NS IV/D5W over 30min q3-4 weeks', 'The 4mg dose here is superior to 5mg dose and more suitable for cancer patients as associated with lower risk of renal dysfunction. Patients should have their serum creatinine levels assessed prior to each dose of Zoledronic acid. In patients who show evidence of renal deterioration during treatment, zoledronic acid should be withheld. Zoledronic acid should only be resumed when serum creatinine returns to within 10% of baseline. Zoledronic acid treatment should be resumed at the same dose as that given prior to treatment interruption.', '!', '2023-05-11 06:50:30', '2023-05-11 06:50:30'),
(197, 301, '5mg/100ml Vial IV over 30min once a year', 'It\'s recommended to be preceeded by vit D bolus dose of 50,000-125,000IU PO/IM especially in patients with a recent low trauma hip fracture. The need for continued treatment should be re-evaluated regularly, particularly after ≥ 5 years of use', '!', '2023-05-11 06:54:12', '2023-05-11 06:54:12'),
(198, 302, '5mg/100ml Vial IV over 30min once a year', 'It\'s recommended to be preceeded by vit D bolus dose of 50,000-125,000IU PO/IM especially in patients with a recent low trauma hip fracture. The need for continued treatment should be re-evaluated regularly, particularly after ≥ 5 years of use', '!', '2023-05-11 06:54:40', '2023-05-11 06:54:40'),
(199, 303, '5mg/100ml Vial IV over 30min once a year', 'It\'s recommended to be preceeded by vit D bolus dose of 50,000-125,000IU PO/IM especially in patients with a recent low trauma hip fracture. The need for continued treatment should be re-evaluated regularly, particularly after ≥ 5 years of use', '!', '2023-05-11 06:55:12', '2023-05-11 06:55:12'),
(200, 304, '5mg/100ml Vial IV over 30min once', 'Plus 500mg calcium PO q12h for at least 10 days following zoledronic acid; most patients of paget\'s disease respond well to the lone dose and remission induced at 1 year. If relapse occurs, you can retreat with the same dose after 1 year interval from the intial dose', '!', '2023-05-11 06:55:41', '2023-05-11 06:55:41'),
(201, 305, 'Choose Indication', '!', '!', '2023-05-11 07:12:03', '2023-05-11 07:12:03'),
(202, 306, '5mg PO once daily', 'Prevention of glucocorticoid-induced osteoporosis in men and women who are either initiating or continuing systemic glucocorticoid treatment (daily dosage of ≥ 7.5 mg of prednisone or equivalent) for chronic diseases. Risedronate is to be taken at least 30 minutes before the first food while in an upright position & not lie down for 30 minutes after taking the tablet to aid delivery of the tablet to the stomach.', '!', '2023-05-11 07:12:47', '2023-05-11 07:12:47'),
(203, 307, '35mg PO once weekly', 'Treatment of osteoporosis in men at high risk of fractures . The need for continued treatment should be re-evaluated periodically based on the benefits and potential risks of risedronate sodium on an individual patient basis, particularly after 5 or more years of use; Risedronate is to be taken at least 30 minutes before the first food while in an upright position & not lie down for 30 minutes after taking the tablet to aid delivery of the tablet to the stomach.', '!', '2023-05-11 07:14:36', '2023-05-11 07:14:36'),
(204, 308, '5mg PO once daily', 'Treatment of postmenopausal osteoporosis, to reduce the risk of vertebral/hip fractures. The need for continued treatment should be re-evaluated periodically based on the benefits and potential risks of risedronate sodium on an individual patient basis, particularly after 5 or more years of use; Risedronate is to be taken at least 30 minutes before the first food while in an upright position & not lie down for 30 minutes after taking the tablet to aid delivery of the tablet to the stomach.', '!', '2023-05-11 07:15:03', '2023-05-11 07:15:03'),
(205, 309, '30mg PO once daily for 2 months', 'Alkaline phosphatase normalization is the evidence of good response. If 2 months treatment fails to normalize serum alkaline phosphatase, retreatment may be considered once patient has been off therapy for at least 2 months; Risedronate is to be taken at least 30 minutes before the first food while in an upright position & not lie down for 30 minutes after taking the tablet to aid delivery of the tablet to the stomach.', '!', '2023-05-11 07:16:09', '2023-05-11 07:16:09'),
(206, 310, 'Contraindicated', 'Risedronate is CI here according to your patient\'s renal status', '!', '2023-05-11 07:32:45', '2023-05-11 07:32:45'),
(207, 312, 'Choose Indication', '!', '!', '2023-05-11 07:54:08', '2023-05-11 07:54:08'),
(208, 313, 'Determine the level of hypercalcemia 1st', '!', '!', '2023-05-11 07:55:02', '2023-05-11 07:55:02'),
(209, 314, '60mg X 500ml NS/D5W IV over 4h once', 'When treating hypercalcemia of malignancy, the serum calcium should be corrected based upon the serum albumin level to determine the appropriate dose. The following equation may be used: Albumin-corrected serum calcium (mg/dL) = serum calcium (mg/dL) + 0.8(4 - serum albumin [grams/dL]). CONCURRENT THERAPY: Vigorous saline hydration is an integral part of hypercalcemia treatment. RETREATMENT: To allow time for a full response after an initial dose, wait a minimum of 7 days before retreatment.', '!', '2023-05-11 08:03:25', '2023-05-11 08:03:25'),
(210, 315, '90mg X 500ml NS/D5W IV over 4h once', 'When treating hypercalcemia of malignancy, the serum calcium should be corrected based upon the serum albumin level to determine the appropriate dose. The following equation may be used: Albumin-corrected serum calcium (mg/dL) = serum calcium (mg/dL) + 0.8(4 - serum albumin [grams/dL]). CONCURRENT THERAPY: Vigorous saline hydration is an integral part of hypercalcemia treatment. RETREATMENT: To allow time for a full response after an initial dose, wait a minimum of 7 days before retreatment.', '!', '2023-05-11 08:03:59', '2023-05-11 08:03:59'),
(211, 316, '30mg X 500ml NS/D5W IV over 4h qDay for 3 days', 'Total cumulative dose of the 3 consecutive days is 90mg. Supplement with calcium and vitamin D if dietary intake inadequate. But, a single dose of zoledronic acid is the drug of choice per paget\'s disease treatment guidelines, due to higher potency, the rare need for retreatment within 5 years, and long-term data for reducing pain and lytic lesions and improving quality of life.', '!', '2023-05-11 08:06:45', '2023-05-11 08:06:45'),
(212, 317, '90mg X 500ml NS/D5W IV over 4h qMonth', 'Supplement with calcium and vitamin D if intake inadequate and no hypercalcemia is present. Limited data are available in patients with a serum creatinine greater than 3 mg/dL. Withhold treatment if the renal function deteriorates. The optimal duration of therapy is not known; however data from a clinical study in myeloma patients indicate that treatment for 21 months is beneficial.', '!', '2023-05-11 08:08:00', '2023-05-11 08:08:00'),
(213, 318, '90mg X 500ml NS/D5W IV over 4h q3-4 weeks', 'Supplement with calcium and vitamin D if intake inadequate and no hypercalcemia is present. Withhold treatment if renal function deteriorates. The optimal duration of therapy is not known; however, data from a clinical study in breast cancer patients indicate that treatment for 24 months is beneficial.', '!', '2023-05-11 08:10:11', '2023-05-11 08:10:11'),
(214, 319, '60mg X 500ml NS/D5W IV over 4h q3 months', 'OR 90mg X 500ml NS/D5W IV over 4h; for male with prostate carcinoma who received combined androgen blockade', '!', '2023-05-11 08:11:01', '2023-05-11 08:11:01'),
(215, 320, '500mg PO q4h as required', 'Daily doses of up to 4g/day may be used', 'Max; 4g/day', '2023-05-11 09:36:29', '2023-05-11 09:36:29'),
(216, 321, '500mg PO q4h as required', 'Avoid use as much as possible according to your patient\'s liver status; limit therapy to short-term use at doses not to exceed 2g/day', 'Max; 2g/day', '2023-05-11 09:37:06', '2023-05-11 09:37:06'),
