(224, 338, '2 Amp (of 300mg) X 100ml NS IV over 30 min', 'Can be used generally as a renoprotective agent especially in contrast agent-associated nephrotoxicity. Administer on day before & day of contrast agent administration.', '!', '2023-05-11 10:08:02', '2023-05-11 10:08:02'),
