(575, 760, '1mg topically used as a swish & spit mouth rinse', 'Up to 4 times daily, we recommend switching to syrup formula as it\'s more suitable. Alternatively, 0.25mg PO at bedtime for 1 week; increase dose by up to 0.25mg qweek; not to exceed 1mg PO q8h', '!', '2023-05-13 00:57:31', '2023-05-13 00:57:31'),
