(581, 767, '5mg PO qDay intially', 'Some patients respond to 2.5mg once daily. If necessary, increase to 10mg PO once daily. Maximum dosage is 20mg/day', '!', '2023-05-13 06:30:30', '2023-05-13 06:30:30'),
(582, 768, '2.5mg PO qDay intially', 'LOWER intial dosage is appropriate for your patient\'s status. If necessary, increase SLOWLY to 10mg PO once daily. Maximum dosage is 20mg/day', '!', '2023-05-13 06:30:49', '2023-05-13 06:30:49'),
(583, 769, '1.25mg PO once daily for 48h', 'THEN 2.5mg PO once daily for the first month, then 5mg PO once daily. Up to 10mg PO once daily has been tolerated', '!', '2023-05-13 06:31:17', '2023-05-13 06:31:17'),
(584, 770, '1.25mg PO once daily for 48h', 'THEN 2.5mg PO once daily for the first month, then 5mg PO once daily. Up to 10mg PO once daily as tolerated; This LOW intial dosage is appropriate for your patient\'s status', '!', '2023-05-13 06:31:35', '2023-05-13 06:31:35'),
(585, 771, '5mg PO qDay intially', 'Up to 20mg/day; Bisoprolol 10mg once daily is usually effective in reducing anginal attack rate in patients with stable effort angina. When discontinuing therapy, the dosage should be gradually tapered over several weeks to avoid rebound angina and adverse cardiac events', '!', '2023-05-13 06:32:07', '2023-05-13 06:32:07'),
(586, 772, '2.5mg PO qDay intially', 'LOWER intial dosage is appropriate for your patient\'s status THEN titrate SLOWLY; Bisoprolol 10mg once daily is usually effective in reducing anginal attack rate in patients with stable effort angina. When discontinuing therapy, the dosage should be gradually tapered over several weeks to avoid rebound angina and adverse cardiac events', '!', '2023-05-13 06:32:24', '2023-05-13 06:32:24'),
(587, 773, '2.5mg PO qDay intially', 'Up to 10mg/day; Clinical practice guidelines recommend the use of beta blockers to control the ventricular rate for patients with paroxysmal, persistent, or permanent atrial fibrillation', '!', '2023-05-13 06:32:55', '2023-05-13 06:32:55'),
(588, 774, '2.5mg PO qDay intially', 'This LOW intial dosage is appropriate for your patient\'s status THEN titrate SLOWLY; Clinical practice guidelines recommend the use of beta blockers to control the ventricular rate for patients with paroxysmal, persistent, or permanent atrial fibrillation', '!', '2023-05-13 06:33:12', '2023-05-13 06:33:12'),
(589, 784, '1 Tab (90/8mg) PO intially for the 1st week', 'For use as adjunct to reduced-calorie diet and increased physical activity for long-term weight management in adults with initial body mass index of ≥30 kg/m² (obese) or ≥27 kg/m² (overweight) in presence of at least 1 weight-related comorbidity (eg, hypertension, type 2 diabetes, or dyslipidemia); increase the daily dose by 1 tablet each subsequent week until daily maintenance dose of 2 tablets twice daily (360 mg bupropion/32 mg naltrexone) is achieved at the start of week 4', '!', '2023-05-13 07:00:37', '2023-05-13 07:00:37'),
(590, 785, '1 Tab (90/8mg) PO intially for the 1st week', 'For use as adjunct to reduced-calorie diet and increased physical activity for long-term weight management in adults with initial body mass index of ≥30 kg/m² (obese) or ≥27 kg/m² (overweight) in presence of at least 1 weight-related comorbidity (eg, hypertension, type 2 diabetes, or dyslipidemia)', '!', '2023-05-13 09:08:54', '2023-05-13 07:08:54'),
