(593, 790, '2 Inhalations PO q12h', 'Indicated for maintenance treatment of bronchoconstriction in patients with chronic obstructive pulmonary disease (COPD)', '!', '2023-05-13 07:18:21', '2023-05-13 07:18:21'),
