(600, 800, '150mg PO qDay', 'May increase to 300mg qDay after 3 days then, may increase more to 450mg qDay after > 4 weeks if no clinical improvement observed with 300mg qDay', '!', '2023-05-13 07:36:24', '2023-05-13 07:36:24'),
