(610, 810, 'Contraindicated', '!', '!', '2023-05-13 07:50:04', '2023-05-13 07:50:04'),
(611, 811, '0.25mg (½ Tab) PO twice weekly', 'Perform a cardiovascular evaluation and consider echocardiography to assess for valvular disease before initiating treatment. May titrate by 0.25 mg/dose every 4 weeks up to 1mg PO twice weekly, if needed. Periodic assessment of cardiac status and consideration of echocardiography are needed for patients who receive long-term treatment. Discontinuation may be considered after 6 months of acceptable serum prolactin concentrations. Assess the need for re-initiation of cabergoline treatment by periodic prolactin determinations', '!', '2023-05-13 07:50:39', '2023-05-13 07:50:39'),
(612, 812, '0.25mg (½ Tab) PO twice weekly', 'Perform a cardiovascular evaluation and consider echocardiography to assess for valvular disease before initiating treatment. May titrate by 0.25 mg/dose every 4 weeks up to 1mg PO twice weekly, if needed. Periodic assessment of cardiac status and consideration of echocardiography are needed for patients who receive long-term treatment. Discontinuation may be considered after 6 months of acceptable serum prolactin concentrations. Assess the need for re-initiation of cabergoline treatment by periodic prolactin determinations', '!', '2023-05-13 07:50:57', '2023-05-13 07:50:57'),
(613, 813, 'Contraindicated', 'History of cardiac valvular disorders as suggested by anatomical evidence of valvulopathy of any valve, making cabergoline CI for your patient', '!', '2023-05-13 07:51:15', '2023-05-13 07:51:15'),
(614, 814, '0.25mg (½ Tab) PO q12h for 2 days', 'It should be noted that this is an unlicensed indication. Rebound lactation has been documented within one to two weeks after initial pharmacological suppression treatment i.e. resumption of milk supply as demonstrated by filling of the breasts and possible leakage of milk. Inform your patient of this possibility', '!', '2023-05-13 07:51:52', '2023-05-13 07:51:52'),
(615, 815, '0.25mg (½ Tab) PO q12h for 2 days', 'It should be noted that this is an unlicensed indication. Rebound lactation has been documented within one to two weeks after initial pharmacological suppression treatment i.e. resumption of milk supply as demonstrated by filling of the breasts and possible leakage of milk. Inform your patient of this possibility', '!', '2023-05-13 07:52:08', '2023-05-13 07:52:08'),
(616, 816, '0.25mg (½ Tab) PO q12h for 2 days', 'Although your patient\'s history of cardiac valvular disorder, cabergoline brief dose for just 2 days may be safe as cardiac valvular abnormalities are associated with prolonged use and cumulative exposure of cabergoline for hyperprolactinemia', '!', '2023-05-13 07:52:28', '2023-05-13 07:52:28'),
(617, 822, '100mg PO qAM', 'This intial dose is appropriate for diabetic control; Dose can be increased to 300mg PO qDay as needed & tolerated', '!', '2023-05-13 08:05:01', '2023-05-13 08:05:01'),
(618, 823, '100mg PO qAM', 'Indicated as an adjunct to diet and exercise to improve glycemic control in type 2 diabetes mellitus (T2DM); This intial dose is appropriate for diabetic control; Dose can be increased to 300mg PO qDay as needed & tolerated', '!', '2023-05-13 08:06:20', '2023-05-13 08:06:20'),
(619, 824, '300mg PO qDay', 'This higher dose is appropriate for diabetic control; AS your patient is on RIFAMPICIN which decreases levels of Canagliflozin', '!', '2023-05-13 08:06:59', '2023-05-13 08:06:59'),
(620, 825, '100mg PO qAM', 'This intial dose is appropriate for diabetic control; Dose can be increased to 300mg PO qDay as needed & tolerated', '!', '2023-05-13 08:10:03', '2023-05-13 08:10:03'),
(621, 826, '100mg PO qAM', 'This intial dose is appropriate for diabetic control.; Dose can\'t be increased more according to your patient\'s status', '!', '2023-05-13 08:10:30', '2023-05-13 08:10:30'),
(622, 827, 'Not Recommended', 'Canagliflozin is not recommended in patients with severe renal impairment who are being treated for glycemic control. However, patients with albuminuria greater than 300mg/day may continue 100mg PO once daily to reduce the risk of ESKD, doubling of serum creatinine, CV death, and hospitalization for heart failure', '!', '2023-05-13 08:10:51', '2023-05-13 08:10:51'),
(623, 828, 'Contraindicated', '!', '!', '2023-05-13 10:15:00', '2023-05-13 08:15:00'),
(624, 829, 'Not Recommended', 'Canagliflozin should be avoided in the late second and third trimesters, during fetal renal development', '!', '2023-05-13 08:11:47', '2023-05-13 08:11:47'),
(625, 830, 'Not Recommended', 'It isn\'t recommended to use Canagliflozin during breastfeeding because of a theoretical risk to the infant\'s developing kidney', '!', '2023-05-13 08:12:11', '2023-05-13 08:12:11'),
(626, 831, 'Not Recommended', 'Moreover than your patient\'s renal status that makes Canagliflozin\'s efficacy lower, Dapagliflozin should be avoided in the late second and third trimesters, during fetal renal development', '!', '2023-05-13 08:13:08', '2023-05-13 08:13:08'),
(627, 832, 'Not Recommended', 'Moreover than your patient\'s renal status that makes Canagliflozin\'s efficacy lower, It isn\'t recommended to use Canagliflozin during breastfeeding because of a theoretical risk to the infant\'s developing kidney', '!', '2023-05-13 08:13:31', '2023-05-13 08:13:31'),
(628, 833, 'Not Recommended', 'Moreover than your patient\'s renal status that makes Canagliflozin\'s efficacy lower, Dapagliflozin should be avoided in the late second and third trimesters, during fetal renal development', '!', '2023-05-13 08:13:54', '2023-05-13 08:13:54'),
(629, 834, 'Not Recommended', 'Moreover than your patient\'s renal status that makes Canagliflozin\'s efficacy lower, It isn\'t recommended to use Canagliflozin during breastfeeding because of a theoretical risk to the infant\'s developing kidney', '!', '2023-05-13 08:14:14', '2023-05-13 08:14:14'),
(630, 835, 'Contraindicated', 'Canagliflozin is CI for your patient as being on dialysis', '!', '2023-05-13 08:14:49', '2023-05-13 08:14:49'),
(631, 836, '50/500mg Tab PO qAM intially', 'Adjust dose based on effectiveness and tolerability guided by DIABETES PANEL; Not to exceed 300mg/2000mg per day', '!', '2023-05-13 08:28:04', '2023-05-13 08:28:04'),
(632, 837, '300mg Canagliflozin PO + 500mg Metformin PO qAM intially', 'This higher dose of Canagliflozin is appropriate for diabetic control; AS your patient is on RIFAMPICIN. So, use of separated formulae is a wise choice', '!', '2023-05-13 08:36:59', '2023-05-13 08:36:59'),
(633, 838, '50/500mg Tab PO qAM intially', 'Adjust dose based on effectiveness and tolerability guided by DIABETES PANEL; Not to exceed 300mg/2000mg per day', '!', '2023-05-13 08:37:39', '2023-05-13 08:37:39'),
(634, 839, '50/500mg PO Tab qAM', 'Despite your patient\'s deteriorated renal status, you can proceed but with more cautious follow-up of kidney function every 3-6 months & limit Canagliflozin daily dose to 100mg. If CrCl gets below 45 ml/min, maximum daily dose of Metformin is 1000mg', '!', '2023-05-13 08:38:05', '2023-05-13 08:38:05'),
(635, 840, 'Contraindicated', '!', '!', '2023-05-13 08:38:45', '2023-05-13 08:38:45'),
