(1363, 1794, '50-100mcg PO Daily Starting Dosage + 2 extra doses', 'Higher levels of thyroid hormone are needed during pregnancy due to increased needs. 2 extra doses added as 1 extra dose on 2 days of the week (9 doses weekly) at earliest knowledge of pregnancy. Adjust at 3-4 week intervals by 50mcg until normal metabolism is steadily maintained; Max 300mcg PO daily', 'Max; 300mcg/day', '2023-05-21 13:26:25', '2023-05-21 11:26:25'),
