(1373, 1804, '5mg PO qDay', 'Indicated for adults with type 2 diabetes mellitus along with diet and exercise to lower blood sugar; may be used as monotherapy or in combination with other common antidiabetic medications; Not be used in patients with type 1 diabetes or for the treatment of diabetic ketoacidosis, as it would not be effective in these settings', '§', '2023-05-21 13:12:21', '2023-05-21 13:12:21'),
(1374, 1808, '2.5/500mg PO q12h intially', 'Intial dosage as your patient is not currently taking Metformin; Adjust dose gradually considering effectiveness and tolerability; Not to exceed daily dose of 5mg of Linagliptin or 2,000mg of metformin', '§', '2023-05-22 02:56:49', '2023-05-22 02:56:49'),
(1375, 1809, '2.5/1000mg PO q12h intially', 'This higher intial dose is appropriate here as your patient is already on Metformin; especially if current regimen is Metformin 850 mg BID or more', '§', '2023-05-22 02:57:14', '2023-05-22 02:57:14'),
(1376, 1810, '2.5/500mg PO q12h intially', 'Despite your patient\'s deteriorated renal status, you can proceed this dosage as a maximum allowed dose but with more cautious follow-up of kidney function every 3-6 months. If CrCl gets below 45 ml/min, If CrCl gets below 45 ml/min, maximum daily dose is 1000mg of Metformin; If CrCl gets below 30 ml/min, Discontinue combination therapy, linagliptin may be continued as a single entity tablet at same total daily dose of 5 mg; no dose adjustment of linagliptin is recommended in patients with renal impairment', '§', '2023-05-22 02:57:29', '2023-05-22 02:57:29'),
(1377, 1811, 'Contraindicated', 'Discontinue combination therapy, linagliptin may be continued as a single entity tablet at same total daily dose of 5 mg; no dose adjustment of linagliptin is recommended in patients with renal impairment', '§', '2023-05-22 05:13:30', '2023-05-22 03:13:30'),
