INSERT INTO `drug_moas` (`id`, `drug_id`, `text`, `created_at`, `updated_at`) VALUES
(3, 347, 'Selective antagonist of postsynaptic alpha-1-adrenoceptors; blockade of adrenoreceptors in the prostate, prostatic capsule, bladder neck and prostatic urethra', '2023-04-29 00:42:47', '2023-04-29 00:42:47'),
(4, 348, 'Selective antagonist of postsynaptic alpha-1-adrenoceptors; blockade of adrenoreceptors in the prostate, prostatic capsule, bladder neck and prostatic urethra', '2023-05-08 10:32:07', '2023-05-08 10:32:07'),
(5, 424, 'Doxazosin competitively inhibits post-synaptic alpha1-adrenergic receptors causing vasodilation of arterioles and veins, which results in decreased total peripheral resistance and blood pressure. Besides, Blocks alpha1 receptors in prostatic stromal and bladder tissues; reduces sympathetic tone-induced urethral stricture responsible for BPH symptoms', '2023-05-08 12:27:57', '2023-05-08 12:27:57'),
(6, 439, 'Terazosin competitively inhibits post-synaptic alpha1-adrenergic receptors causing vasodilation of arterioles and veins, which results in decreased total peripheral resistance and blood pressure. Besides, Blocks alpha1 receptors in prostatic stromal and bladder tissues; reduces sympathetic tone-induced urethral stricture responsible for BPH symptoms', '2023-05-08 22:30:16', '2023-05-08 22:30:16'),
(7, 444, 'Blocks alpha1 adrenergic receptor in smooth muscle of prostate, decreasing bladder neck and urethral resistance', '2023-05-09 06:59:14', '2023-05-09 06:59:14'),
(8, 448, 'Dutasteride: 5-alpha-reductase/ Tamsulosin: Alpha-adrenergic antagonist; blocks alpha-1a adrenergic receptor in smooth muscle of prostate, decreasing bladder neck & urethral resistance', '2023-05-09 21:03:43', '2023-05-09 21:03:43'),
(9, 446, 'Selective inhibitor of type 1 and type 2 isoforms of 5-alpha-reductase; suppresses serum dihydrotestosterone levels by inhibiting the conversion of testosterone to dihydrotestosterone', '2023-05-09 21:04:55', '2023-05-09 21:04:55'),
(10, 451, 'Methyldopa may lower blood pressure by stimulating central inhibitory alpha-adrenergic receptors, false neurotransmission, and/or reduction of plasma renin activity', '2023-05-10 00:14:01', '2023-05-10 00:14:01'),
(11, 1548, 'Interferes with DNA polymerase to inhibit DNA replication via chain termination', '2023-05-10 06:32:02', '2023-05-10 06:32:02'),
(12, 2066, 'Beta2 receptor agonist with some beta1 activity; relaxes bronchial smooth muscle with little effect on heart rate', '2023-05-10 12:48:45', '2023-05-10 12:48:45'),
(13, 2038, 'Bisphosphonate; binds to hydroxyapatite crystals in bone and inhibits osteoclast-mediated bone resorption; decreases mineral release and collagen or matrix breakdown in bone', '2023-05-10 13:39:59', '2023-05-10 13:39:59');
INSERT INTO `drug_pregnancies` (`id`, `drug_id`, `pregnancy_safety_id`, `note`, `created_at`, `updated_at`) VALUES
(4, 347, 3, 'Alfuzosin should be used during pregnancy only if the possible benefit outweighs the possible risk to the unborn baby', '2023-04-29 00:40:32', '2023-04-29 00:40:32'),
(5, 347, 6, 'Because of the low levels of alfuzosin in breastmilk, amounts ingested by the infant are small and would not be expected to cause any adverse effects in breastfed infants', '2023-04-29 00:40:58', '2023-04-29 00:40:58'),
(6, 348, 3, 'Alfuzosin should be used during pregnancy only if the possible benefit outweighs the possible risk to the unborn baby', '2023-05-08 10:31:04', '2023-05-08 10:31:04'),
(7, 348, 6, 'Because of the low levels of alfuzosin in breastmilk, amounts ingested by the infant are small and would not be expected to cause any adverse effects in breastfed infants', '2023-05-08 10:31:18', '2023-05-08 10:31:18'),
(8, 424, 3, 'Doxazosin should be used during pregnancy only if the possible benefit outweighs the possible risk to the unborn baby', '2023-05-08 12:21:28', '2023-05-08 12:21:28'),
(9, 424, 6, 'Because of the low levels of doxazosin in breastmilk, amounts ingested by the infant are small and would not be expected to cause any adverse effects in breastfed infants', '2023-05-08 12:21:44', '2023-05-08 12:21:44'),
(10, 439, 3, 'Terazosin should be used during pregnancy only if the possible benefit outweighs the possible risk to the unborn baby', '2023-05-09 00:27:35', '2023-05-08 22:27:35'),
(11, 439, 6, 'Because of the low levels of terazosin in breastmilk, amounts ingested by the infant are small and would not be expected to cause any adverse effects in breastfed infants', '2023-05-08 22:27:24', '2023-05-08 22:27:24'),
(12, 444, 2, 'No proven risk in humans', '2023-05-09 06:43:41', '2023-05-09 06:43:41'),
(13, 444, 6, 'Because it is 94 to 99% bound to plasma proteins, amounts in milk are likely to be small. If tamsulosin is required by the mother, it is not a reason to discontinue breastfeeding', '2023-05-09 06:43:58', '2023-05-09 06:43:58'),
(14, 446, 5, 'Dutasteride is generally CI during pregnancy. To the extent that, it is forbidden for dutasteride user to donate blood until at least 6 mo following last dose to prevent administration of dutasteride to a pregnant female transfusion recipient', '2023-05-09 14:10:30', '2023-05-09 12:10:30'),
(15, 446, 7, 'Breastfeeding should be stopped while using dutasteride', '2023-05-09 12:03:24', '2023-05-09 12:03:24'),
(16, 448, 5, 'Dutasteride is generally CI during pregnancy. To the extent that, it is forbidden for dutasteride user to donate blood until at least 6 mo following last dose to prevent administration of dutasteride to a pregnant female transfusion recipient', '2023-05-09 20:59:44', '2023-05-09 20:59:44'),
(17, 448, 7, 'Breastfeeding should be stopped while using dutasteride', '2023-05-09 21:00:01', '2023-05-09 21:00:01'),
(18, 451, 2, 'Methyldopa is generally considered safe during pregnancy', '2023-05-10 00:02:52', '2023-05-10 00:02:52'),
(19, 451, 6, 'Because of the low levels of methyldopa in breastmilk, amounts ingested by the infant are small and would not be expected to cause any adverse effects in breastfed infants', '2023-05-10 00:03:07', '2023-05-10 00:03:07'),
(20, 1548, 2, 'Acyclovir is a pregnancy category B drug, and, before 20 weeks of gestation, should be used when potential benefits outweigh risk', '2023-05-10 06:11:33', '2023-05-10 06:11:33'),
(21, 1548, 6, 'The American Academy of Pediatrics considers acyclovir to be safe during breastfeeding', '2023-05-10 06:11:48', '2023-05-10 06:11:48'),
(22, 2066, 3, 'Albuterol (salbutamol) is considered safe to use during pregnancy. It\'s a first-choice rescue inhaler to use in pregnancy', '2023-05-10 12:46:47', '2023-05-10 12:46:47'),
(23, 2066, 6, 'Albuterol (salbutamol) inhaler is not thought to pass into breast milk in large amounts. Inhaled bronchodilators are generally considered acceptable for use during breastfeeding', '2023-05-10 12:47:02', '2023-05-10 12:47:02'),
(24, 2038, 3, 'Alendronate is not indicated for use in women of reproductive potential; there are no data with alendronate use in pregnant women to inform any drug-associated risks', '2023-05-10 13:32:59', '2023-05-10 13:32:59'),
(25, 2038, 6, 'Negligible levels anticipated in milk, due to drug’s properties, with subsequent minimal absorption from the infant’s GI tract', '2023-05-10 13:33:12', '2023-05-10 13:33:12'),
(26, 2045, 3, 'Ibandronate is not indicated for use in women of reproductive potential; there are no data with ibandronate use in pregnant women to inform any drug-associated risks', '2023-05-10 18:15:04', '2023-05-10 18:15:04'),
(27, 2045, 6, 'Ibandronate is poorly absorbed orally (average in adults 6% on an empty stomach, negligible with food), so absorption of ibandronate by a breastfed infant is unlikely', '2023-05-10 18:15:17', '2023-05-10 18:15:17'),
(28, 2046, 3, 'Ibandronate is not indicated for use in women of reproductive potential; there are no data with ibandronate use in pregnant women to inform any drug-associated risks', '2023-05-10 19:11:50', '2023-05-10 19:11:50'),
(29, 2046, 6, 'Ibandronate is poorly absorbed orally (average in adults 6% on an empty stomach, negligible with food), so absorption of ibandronate by a breastfed infant is unlikely', '2023-05-10 19:12:04', '2023-05-10 19:12:04'),
(30, 3280, 3, 'Ibandronate is not indicated for use in women of reproductive potential; there are no data with ibandronate use in pregnant women to inform any drug-associated risks', '2023-05-10 19:46:14', '2023-05-10 19:46:14'),
(31, 3280, 6, 'Ibandronate is poorly absorbed orally (average in adults 6% on an empty stomach, negligible with food), so absorption of ibandronate by a breastfed infant is unlikely', '2023-05-10 19:46:31', '2023-05-10 19:46:31'),
(32, 2055, 4, 'Zoledronic acid is a pregnancy Category D drug and should not be used in pregnant women', '2023-05-10 22:41:51', '2023-05-10 22:41:51'),
(33, 2055, 7, 'It is not known whether zoledronic acid is excreted into human milk. Zoledronic acid is contraindicated in breast-feeding women', '2023-05-10 22:42:14', '2023-05-10 22:42:14'),
(34, 2056, 4, 'Zoledronic acid is a pregnancy Category D drug and should not be used in pregnant women', '2023-05-11 06:32:48', '2023-05-11 06:32:48'),
(35, 2056, 7, 'It is not known whether zoledronic acid is excreted into human milk. Zoledronic acid is contraindicated in breast-feeding women', '2023-05-11 06:33:06', '2023-05-11 06:33:06'),
(36, 2047, 3, 'Risedronate is not usually recommended during pregnancy. This is because there has not been enough research into its safety', '2023-05-11 07:44:22', '2023-05-11 07:44:22'),
(37, 2047, 6, 'Negligible levels anticipated in milk, due to drug’s properties, with subsequent minimal absorption from the infant’s GI tract', '2023-05-11 07:44:36', '2023-05-11 07:44:36'),
(38, 2050, 4, 'The use of pamidronate is not recommended in women who may become pregnant or during pregnancy. However, based solely on the limited human pregnancy experience, inadvertent exposure does not appear to represent a major risk to the embryo or fetus, but infants should be monitored for hypocalcemia during the first few days after birth', '2023-05-11 08:13:35', '2023-05-11 08:13:35'),
(39, 2050, 6, 'Although the oral bioavailability of pamidronate in infants is not known, in adults it is very low, about 2% in the fasting state. Moreover, the drug is highly bound by calcium and should not be absorbable from milk. Based on these data, breastfeeding appears to be compatible with pamidronate therapy, but withholding nursing for 12–24 hours should ensure that the infant is exposed to little or no drug', '2023-05-11 08:15:52', '2023-05-11 08:15:52'),
(40, 506, 2, 'Paracetamol is safe for your pregnant patient', '2023-05-11 09:47:17', '2023-05-11 09:47:17'),
(41, 506, 6, 'It is OK to prescribe paracetamol during breastfeeding', '2023-05-11 09:47:31', '2023-05-11 09:47:31'),
(42, 2170, 2, 'There is no evidence of risk with use in pregnancy', '2023-05-11 10:14:24', '2023-05-11 10:14:24'),
(43, 2170, 6, 'To avoid infant exposure, nursing mothers may consider pumping and discarding their milk for 30 hours after administration', '2023-05-11 10:14:33', '2023-05-11 10:14:33'),
(44, 2167, 2, 'There is no evidence of risk with use in pregnancy', '2023-05-11 10:26:42', '2023-05-11 10:26:42'),
(45, 2167, 6, 'To avoid infant exposure, nursing mothers may consider pumping and discarding their milk for 30 hours after administration', '2023-05-11 10:27:01', '2023-05-11 10:27:01'),
(46, 1551, 2, 'Acyclovir is a pregnancy category B drug, and, before 20 weeks of gestation, should be used when potential benefits outweigh risk', '2023-05-11 13:22:11', '2023-05-11 13:22:11'),
(47, 1551, 6, 'The American Academy of Pediatrics considers acyclovir to be safe during breastfeeding', '2023-05-11 13:22:28', '2023-05-11 13:22:28'),
(48, 1658, 3, 'During pregnancy, allopurinol should be used only when clearly needed', '2023-05-11 21:15:14', '2023-05-11 21:15:14'),
(49, 1658, 6, 'If allopurinol is required by the mother, it is not a reason to discontinue breastfeeding, but exclusively breastfed infants should be monitored if this drug is used, including observation for allergic reactions (such as rash) and periodic CBC and differential blood counts', '2023-05-11 21:15:36', '2023-05-11 21:15:36'),
(50, 985, 2, 'Studies showed that Alogliptin did not impair fertility or harm the fetus. There are, however, no adequate and well-controlled studies in pregnant women. Because animal reproduction studies are not always predictive of human response, this drug should be used during pregnancy only if clearly needed', '2023-05-11 21:27:57', '2023-05-11 21:27:57'),
(51, 985, 7, 'Alogliptin is not usually recommended while breastfeeding', '2023-05-11 21:28:15', '2023-05-11 21:28:15'),
(52, 986, 2, 'Studies showed that Alogliptin did not impair fertility or harm the fetus. There are, however, no adequate and well-controlled studies in pregnant women. Because animal reproduction studies are not always predictive of human response, this drug should be used during pregnancy only if clearly needed', '2023-05-11 21:57:16', '2023-05-11 21:57:16'),
(53, 986, 7, 'Alogliptin is not usually recommended while breastfeeding', '2023-05-11 21:57:31', '2023-05-11 21:57:31'),
(54, 2855, 4, 'Most benzodiazepines have a category D rating within the U.S. Food and Drug Administration (FDA) Pregnancy Categories. This means that there is some positive evidence of human fetal risk, but the potential benefits may warrant use of benzodiazepines in pregnant women.', '2023-05-11 22:32:52', '2023-05-11 22:32:52'),
(55, 2855, 6, 'Alprazolam at low doses is probably compatible with breastfeeding as long as infant is not symptomatic; advise to avoid the peak times and monitor infant for sedation, slowed breathing rate, poor feedings and poor weight gain.', '2023-05-11 22:33:18', '2023-05-11 22:33:18'),
(56, 2504, 2, 'During pregnancy, amiloride/hydrochlorothiazide should be used only when clearly needed', '2023-05-11 23:23:02', '2023-05-11 23:23:02'),
(57, 2504, 6, 'It is OK to prescribe hydrochlorothiazide during breastfeeding', '2023-05-11 23:23:40', '2023-05-11 23:23:40'),
(58, 2157, 3, 'During pregnancy, aminophylline should be used only when clearly needed', '2023-05-11 23:50:50', '2023-05-11 23:50:50'),
(59, 2157, 6, 'Aminophylline is considered to be acceptable during breastfeeding. But, may occasionally cause stimulation and irritability and fretful sleep in infants', '2023-05-11 23:51:05', '2023-05-11 23:51:05'),
(60, 1866, 3, 'Amlodipine should be used during pregnancy only if the potential benefit justifies the potential risk to the fetus', '2023-05-12 00:17:42', '2023-05-12 00:17:42'),
(61, 1866, 6, 'Amlodipine passes into breast milk in small amounts and has not been known to cause side effects in breastfed babies', '2023-05-12 00:17:51', '2023-05-12 00:17:51'),
(62, 1312, 2, 'Co-amoxiclav appears to be relatively safe during pregnancy', '2023-05-12 01:18:52', '2023-05-12 01:18:52'),
(63, 1312, 6, 'Co-amoxiclav is acceptable in nursing mothers', '2023-05-12 01:19:15', '2023-05-12 01:19:15'),
(64, 1314, 2, 'Co-amoxiclav appears to be relatively safe during pregnancy', '2023-05-12 01:50:59', '2023-05-12 01:50:59'),
(65, 1314, 6, 'Co-amoxiclav is acceptable in nursing mothers', '2023-05-12 01:51:20', '2023-05-12 01:51:20'),
(66, 763, 2, 'During pregnancy, Apixaban should be used only when clearly needed', '2023-05-12 12:49:49', '2023-05-12 12:49:49'),
(67, 763, 7, 'Category: L4 - No Data-Possibly Hazardous', '2023-05-12 12:50:07', '2023-05-12 12:50:07'),
(68, 1800, 4, 'Atenolol can cause fetal harm when administered to a pregnant woman', '2023-05-12 14:15:06', '2023-05-12 14:15:06'),
(69, 1800, 7, 'Atenolol passes into breast milk in different amounts, and sometimes these have been quite high; atenolol is favoured least in breastfed infants', '2023-05-12 14:15:20', '2023-05-12 14:15:20'),
(70, 2400, 3, 'Atomoxetine should not be used during pregnancy unless the potential benefit justifies the potential risk to the foetus', '2023-05-12 17:20:36', '2023-05-12 17:20:36'),
(71, 2400, 6, 'There is no published experience with atomoxetine during breastfeeding, although reports from the manufacturer found no serious adverse effects in two breastfed infants. An alternate drug may be preferred, especially while nursing a newborn or preterm infant', '2023-05-12 17:20:49', '2023-05-12 17:20:49'),
(72, 2623, 5, 'This determination is based on the overarching concept that the benefits of statin therapy during pregnancy do not outweigh potential fetal risks of exposure', '2023-05-12 19:12:02', '2023-05-12 19:12:02'),
(73, 2623, 6, 'It may be OK to prescribe Atorvastatin during breastfeeding', '2023-05-12 19:12:16', '2023-05-12 19:12:16'),
(74, 2570, 4, 'Doses < 200mg/day have not been associated with an increased risk of congenital malformations, stillbirth and miscarriages', '2023-05-12 21:38:19', '2023-05-12 21:38:19'),
(75, 2570, 6, 'Doses < 200mg/day may be safe in breastfeeding women', '2023-05-12 21:39:02', '2023-05-12 21:39:02'),
(76, 1348, 2, 'Azithromycin is generally thought to be OK during pregnancy', '2023-05-13 00:31:54', '2023-05-13 00:31:54'),
(77, 1348, 6, 'Azithromycin is compatible with breastfeeding', '2023-05-13 00:32:10', '2023-05-13 00:32:10'),
(78, 2679, 3, 'During pregnancy, baclofen should be used only when clearly needed', '2023-05-13 00:40:57', '2023-05-13 00:40:57'),
(79, 2679, 6, 'Only a very small amount of baclofen passes into breast milk; it appears to be compatible with breastfeeding', '2023-05-13 00:41:10', '2023-05-13 00:41:10'),
(80, 1350, 2, 'Azithromycin is generally thought to be OK during pregnancy', '2023-05-13 00:48:10', '2023-05-13 00:48:10'),
(81, 1350, 6, 'Azithromycin is compatible with breastfeeding', '2023-05-13 00:48:28', '2023-05-13 00:48:28'),
