(209, 2103, 3, 'Ipratropium is considered safe to use during pregnancy. It\'s a first-choice rescue inhaler to use in pregnancy', '2023-05-20 11:34:25', '2023-05-20 11:34:25'),
(210, 2103, 6, 'Ipratropium inhaler is not thought to pass into breast milk in large amounts. Inhaled bronchodilators are generally considered acceptable for use during breastfeeding', '2023-05-20 11:34:38', '2023-05-20 11:34:38'),
(211, 1740, 4, 'The use of AIIRAs is contra-indicated during the second and third trimester of pregnancy', '2023-05-20 21:28:10', '2023-05-20 21:28:10'),
(212, 1740, 6, 'It is unlikely to cause side effects in baby. However, there is a very small risk that it could also lower baby\'s blood pressure', '2023-05-20 21:28:22', '2023-05-20 21:28:22'),
(213, 3126, 3, 'During pregnancy, isosorbide dinitrate should be used only when clearly needed', '2023-05-20 21:40:18', '2023-05-20 21:40:18'),
(214, 3126, 6, 'Isosorbide dinitrate can be used during breastfeeding with caution. Infants should be monitored for drowsiness, lethargy, and poor feeding and weight gain. Flushing is an unlikely side-effect in the infant when used at lower doses longer term', '2023-05-20 21:40:31', '2023-05-20 21:40:31'),
(215, 3137, 3, 'During pregnancy, isosorbide mononitrate should be used only when clearly needed', '2023-05-20 21:48:54', '2023-05-20 21:48:54'),
(216, 3137, 6, 'Isosorbide mononitrate can be used during breastfeeding with caution. Infants should be monitored for drowsiness, lethargy, and poor feeding and weight gain. Flushing is an unlikely side-effect in the infant when used at lower doses longer term', '2023-05-20 21:49:07', '2023-05-20 21:49:07'),
(217, 562, 3, 'Ketoprofen should only be prescribed after week 30 of pregnancy if ultimately necessary', '2023-05-20 22:57:40', '2023-05-20 22:57:40'),
(218, 562, 6, 'Ketoprofen passes into breast milk in very small amounts. It has not been known to cause any side effects in breastfed babies', '2023-05-20 22:57:52', '2023-05-20 22:57:52'),
(219, 1823, 3, 'Labetalol is generally considered safe during pregnancy', '2023-05-20 23:23:39', '2023-05-20 23:23:39'),
(220, 1823, 6, 'Because of the low levels of labetalol in breastmilk, amounts ingested by the infant are small and would not be expected to cause any adverse effects in breastfed infants', '2023-05-20 23:23:50', '2023-05-20 23:23:50'),
(221, 834, 3, 'Current data on humans suggest that lamotrigine is less teratogenic than most of other commonly used AEDs', '2023-05-21 01:00:18', '2023-05-21 01:00:18'),
(222, 834, 6, 'Breastfeeding during lamotrigine monotherapy does not appear to adversely affect infant growth or development', '2023-05-21 01:00:35', '2023-05-21 01:00:35'),
(223, 654, 2, 'Lansoprazole should be used during pregnancy only if the benefit outweighs the risk to the fetus', '2023-05-21 02:17:23', '2023-05-21 02:17:23'),
(224, 654, 6, 'It is OK to prescribe Lansoprazole during breastfeeding', '2023-05-21 02:17:35', '2023-05-21 02:17:35'),
(225, 842, 3, 'During pregnancy, levetiracetam should be used only when clearly needed', '2023-05-21 02:31:12', '2023-05-21 02:31:12'),
(226, 842, 6, 'Levels of levetiracetam in milk can be relatively high in some women and can occasionally cause sedation and other adverse effects in their breastfed infants. If levetiracetam is required by the mother, it is not necessarily a reason to discontinue breastfeeding', '2023-05-21 02:31:28', '2023-05-21 02:31:28'),
(227, 846, 3, 'During pregnancy, levetiracetam should be used only when clearly needed', '2023-05-21 03:50:05', '2023-05-21 03:50:05'),
(228, 846, 6, 'Levels of levetiracetam in milk can be relatively high in some women and can occasionally cause sedation and other adverse effects in their breastfed infants. If levetiracetam is required by the mother, it is not necessarily a reason to discontinue breastfeeding', '2023-05-21 03:50:18', '2023-05-21 03:50:18'),
(229, 1697, 2, 'Levocetirizine is not expected to harm an unborn baby', '2023-05-21 04:04:53', '2023-05-21 04:04:53'),
(230, 1697, 6, 'All antihistamines are considered safe to use during breastfeeding, as minimal amounts are excreted in the breast milk and would not cause any adverse effects on a breastfeeding infant', '2023-05-21 04:05:07', '2023-05-21 04:05:07'),
(231, 2961, 5, '§', '2023-05-21 04:41:40', '2023-05-21 04:41:40'),
(232, 2961, 6, '§', '2023-05-21 04:43:15', '2023-05-21 04:43:15'),
(233, 979, 2, 'Like the other DPP-4 inhibitors, linagliptin is a Pregnancy Category B drug, and it should be used during pregnancy only if it is clearly needed', '2023-05-21 13:16:33', '2023-05-21 13:16:33'),
(234, 979, 6, 'Linagliptin\'s plasma protein binding ranges from 80% to over 99%, so it is unlikely to pass into breastmilk in clinically important amounts and might be a better choice among drugs in this class for nursing mothers', '2023-05-21 13:16:46', '2023-05-21 13:16:46'),
(235, 980, 2, 'Like the other DPP-4 inhibitors, linagliptin is a Pregnancy Category B drug, and it should be used during pregnancy only if it is clearly needed', '2023-05-22 03:20:22', '2023-05-22 03:20:22'),
(236, 980, 6, 'Linagliptin\'s plasma protein binding ranges from 80% to over 99%, so it is unlikely to pass into breastmilk in clinically important amounts and might be a better choice among drugs in this class for nursing mothers', '2023-05-22 03:20:45', '2023-05-22 03:20:45'),
(237, 1146, 3, 'LIRAGLUTIDE should be used during pregnancy only if the potential benefit justifies the potential risk to the fetus', '2023-05-22 03:54:30', '2023-05-22 03:54:30'),
(238, 1146, 6, 'Because LIRAGLUTIDE is a large peptide molecule, the amount in milk is likely to be very low and absorption is unlikely because it is probably destroyed in the infant\'s gastrointestinal tract. USE with caution during breastfeeding, especially while nursing a newborn or preterm infant.', '2023-05-22 03:55:02', '2023-05-22 03:55:02'),
(239, 1147, 5, 'SAXENDA is contraindicated during pregnancy because weight loss offers no potential benefit to a pregnant woman and may result in fetal harm', '2023-05-22 04:07:34', '2023-05-22 04:07:34'),
(240, 1147, 6, 'Because LIRAGLUTIDE is a large peptide molecule, the amount in milk is likely to be very low and absorption is unlikely because it is probably destroyed in the infant\'s gastrointestinal tract. USE with caution during breastfeeding, especially while nursing a newborn or preterm infant.', '2023-05-22 04:07:49', '2023-05-22 04:07:49'),
(241, 1722, 3, 'The FDA advisory states that the use of ACE inhibitors in the first trimester of pregnancy may lead to an increased risk of birth defects', '2023-05-22 06:44:50', '2023-05-22 06:44:50'),
(242, 1722, 4, 'There is already a black box warning on the labeling of all ACE inhibitors that warns of fetal harm in the second and third trimesters. The use of ACE inhibitors during the second and third trimesters of pregnancy has been associated with fetal and neonatal injury, including hypotension, neonatal skull hypoplasia, anuria, reversible or irreversible renal failure, and death. Oligohydramnios has also been reported, presumably resulting from decreased fetal renal function; oligohydramnios in this setting has been associated with fetal limb contractures, craniofacial deformation, and hypoplastic lung development. Prematurity, intrauterine growth retardation, and patent ductus arteriosus have also been reported, although it is not clear whether these occurrences were due to the ACE inhibitor exposure', '2023-05-22 06:45:14', '2023-05-22 06:45:14'),
(243, 1722, 4, 'There is already a black box warning on the labeling of all ACE inhibitors that warns of fetal harm in the second and third trimesters. The use of ACE inhibitors during the second and third trimesters of pregnancy has been associated with fetal and neonatal injury, including hypotension, neonatal skull hypoplasia, anuria, reversible or irreversible renal failure, and death. Oligohydramnios has also been reported, presumably resulting from decreased fetal renal function; oligohydramnios in this setting has been associated with fetal limb contractures, craniofacial deformation, and hypoplastic lung development. Prematurity, intrauterine growth retardation, and patent ductus arteriosus have also been reported, although it is not clear whether these occurrences were due to the ACE inhibitor exposure', '2023-05-22 06:45:43', '2023-05-22 06:45:43'),
(244, 1722, 6, 'It is unlikely to cause side effects in baby. However, there is a very small risk that it could also lower baby\'s blood pressure', '2023-05-22 06:45:56', '2023-05-22 06:45:56'),
(245, 1695, 2, 'During pregnancy, loratadine is a preferred antihistamine', '2023-05-22 06:56:23', '2023-05-22 06:56:23'),
(246, 1695, 6, 'All antihistamines are considered safe to use during breastfeeding, as minimal amounts are excreted in the breast milk and would not cause any adverse effects on a breastfeeding infant', '2023-05-22 06:57:00', '2023-05-22 06:57:00'),
(247, 2634, 5, 'This determination is based on the overarching concept that the benefits of statin therapy during pregnancy do not outweigh potential fetal risks of exposure', '2023-05-22 07:27:17', '2023-05-22 07:27:17'),
(248, 2634, 6, 'It may be OK to prescribe Lovastatin during breastfeeding', '2023-05-22 07:27:30', '2023-05-22 07:27:30'),
(249, 1185, 2, 'It is safe to use to treat nausea and vomiting during pregnancy. It is not thought to harm an unborn baby', '2023-05-22 07:51:25', '2023-05-22 07:51:25'),
(250, 1185, 6, 'Occasional doses of meclizine (or when used PRN) are probably acceptable during breastfeeding. Large doses or more prolonged use may cause effects in the infant or decrease the milk supply, particularly in combination with a sympathomimetic such as pseudoephedrine or before lactation is well established', '2023-05-22 07:51:40', '2023-05-22 07:51:40'),
(251, 589, 3, 'During the early stages of pregnancy, the risks of using mefenamic acid are at their lowest', '2023-05-22 08:54:35', '2023-05-22 08:54:35'),
(252, 589, 4, 'Mefenamic acid should only be prescribed after week 30 of pregnancy if ultimately necessary. But, generally, It\'s contraindicated in late pregnancy', '2023-05-22 08:54:49', '2023-05-22 08:54:49'),
(253, 589, 6, 'Probably safe. But, other NSAIDs may be preferable while nursing a newborn or preterm infant', '2023-05-22 08:55:01', '2023-05-22 08:55:01'),
(254, 585, 3, 'During the early stages of pregnancy, the risks of using meloxicam are at their lowest', '2023-05-22 09:16:16', '2023-05-22 09:16:16');
