(91, 201, 'Symptoms of lithium toxicity, not always associated with raised lithium levels, have been described in patients and healthy subjects when they were also given methyldopa. Monitoring lithium levels may be unreliable because symptoms of toxicity can occur even though the levels remain within the normally accepted therapeutic range.', '2023-05-10 00:01:00', '2023-05-10 00:01:00'),
(92, 243, 'Aciclovir does not normally seem to affect ciclosporin concentrations or worsen renal function on concurrent use, but cases of nephrotoxicity and increased ciclosporin concentrations have been reported. Renal function should be closely monitored if both drugs are given.', '2023-05-10 06:55:01', '2023-05-10 06:55:01'),
