(441, 1821, 'Liraglutide is not expected to alter the absorption of warfarin. In addition, liraglutide does not affect cytochrome P450, by which warfarin is principally metabolised. No interaction would therefore be expected. However, the UK manufacturer states that a clinically relevant interaction with active substances with narrow therapeutic index such as warfarin cannot be excluded. The UK manufacturer recommends that more frequent monitoring of the INR is recommended if patients taking warfarin are given liraglutide. As there is little clinical experience with liraglutide, this might be prudent', '2023-05-22 03:53:00', '2023-05-22 03:53:00'),
(442, 1822, 'LIRAGLUTIDE delays gastric emptying, which may affect absorption of concomitantly administered oral medications; So generally they should be taken at least 1 hr before Liraglutide administration; Initial dose of 0.6mg SC qDay is only to decrease GI adverse effects and does not provide glycemic control', '2023-05-22 03:53:34', '2023-05-22 03:53:34'),
